import React from 'react';
import styled from 'styled-components';
import '../css/App.css';

export default function header() {
    const Header = styled.header`
        padding: 20px 0;
        background-color: #d4e9e2;
    `;

    return (
        <Header>
            <div className="container">
                <h1>Movie App</h1>
            </div>
        </Header>
    )
}
